  },
  "description": {
    "nb": "Datasettet beitehage viser områder lukket med gjerder der tamrein blir samlet/ oppbevart for foring eller i påvente av å bli drevet inn i lukka arbeidsområder for f.eks. merking eller slakt.\nKartene er å regne som illustrasjon på hvordan reindriftsnæringen i hovedsak og normalt bruker områdene. Lov om reindrift (reindriftsloven) regulerer hvilke rettigheter og plikter reindriftsutøvere har i forhold til arealbruk."
  },
