  "title": {
    "nb": "FKB-Arealbruk"
  },
  "description": {
    "nb": "Arealbruk beskriver den fysiske bruk av et geografisk område. Eksempler på dette er parkering på et jorde som vil kodes som en parkeringsplass, uavhengig av om dette arealstykke egner seg som fulldyrka. Arealbruken må holdes atskilt fra markslagsbeskrivelsene som beskriver jordas bærevne (arealtilstand, bonitet, markslag og mineralske råstoffer). En del objekter befinner seg derimot i et grenseland, og det kan være vanskelig å avgjøre i hvilke kapittel de ulike objektene hører hjemme."
  },
