  "title": {
    "nb": "Vannregioner"
  },
  "description": {
    "nb": "En vannregion er administrativ inndeling for forvaltning av vann og vassdrag, inkludert grunnvannsforekomster og kystnære marine områder. Inndelingen bygger på inndelingskriteringer fra vannforskriften, som implementerer EUs vannrammedirektiv (Water Framework Directive). Norge er inndelt i totalt 18 vannregioner, hvorav 7 av disse er internasjonale med Sverige og Finland. \nDe helnorske regionene er; Glomma, Vest-Viken, Agder, Rogaland, Hordaland, Sogn- og Fjordane, Møre- og Romsdal, Trøndelag, Nordland, Troms, Finnmark. \nI tillegg til disse har følgende vannregioner arealer på norsk territorium: Västerhavet, Bottenhavet, Botenviken (Sverige), og Torneå, Tornionjoen og Kemijoki (Finland)."
  },
