  "title": {
    "nb": "Sjøkart - elektroniske (ENC)"
  },
  "description": {
    "nb": "ENC (Electronic Navigational Charts) er den internasjonale betegnelsen for offisielle elektroniske sjøkart. I Norge er det Kartverket som er sjøkartmyndighet, og produserer og oppdaterer landets offisielle elektroniske sjøkart (ENC-er).\n\nEn ENC er et vektorkart som inneholder all informasjon som er nødvendig for sikker seilas. Disse elektroniske sjøkartene er fremstilt i henhold til den internasjonale hydrografiske organisasjonen (IHO) sin standard for utveksling av digital sjøkartinformasjon, S57."
  },
