  "description": {
    "nb": "Datasettet Eksplosivanlegg viser anlegg hvor eksplosive varer tilvirkes eller oppbevares, og som har tillatelse fra Direktoratet for samfunnssikkerhet og beredskap (DSB) , se §§ 6.1 og 7.1 i forskrift 26. juni 2002 nr. 922 om håndtering av eksplosjonsfarlig stoff (eksplosivforskriften). Merk at dette ikke omfatter Forsvarets anlegg.\nDatasettet gis bare ut til bruk i kommunal og regional beredskap, arealplanlegging og byggesaksbehandling og bare ved direkte henvendelse til DSB v/ kart@dsb.no eller karen.lie@dsb.no"
