  "title": {
    "nb": "Administrative enheter kommuner 2019"
  },
  "description": {
    "nb": "Datasettet viser kommuneinndelingen i landet med de mest nøyaktige grenser som er registrert digitalt og som er samlet i ett datasett. \n\nKommunene avgrenses av følgende grensetyper: riksgrense, territorialgrense, avgrensningslinje i sjø, fylkesgrense og kommunegrense.\n\nI tillegg inneholder datasettet grunnlinje og 1 nautisk mil, som er juridiske linjer utenfor kysten. \n\nFlatene inneholder egenskaper som forteller om offisielle kommunenumre. De offisielle norske, samiske og kvenske navnene for kommunene er hentet fra SSR. I tillegg finnes informasjon om samiske forvaltningsområder.\n\nGeometrien er avledet fra matrikkelen, som blir ajourført av kommunene. Riksgrense og territorialgrense er lagt inn fra Kartverkets egne etablerte filer."
  },
  "descriptionFormatted": {
    "nb": "Datasettet viser kommuneinndelingen i landet med de mest nøyaktige grenser som er registrert digitalt og som er samlet i ett datasett. \n\nKommunene avgrenses av følgende grensetyper: riksgrense, territorialgrense, avgrensningslinje i sjø, fylkesgrense og kommunegrense.\n\nI tillegg inneholder datasettet grunnlinje og 1 nautisk mil, som er juridiske linjer utenfor kysten. \n\nFlatene inneholder egenskaper som forteller om offisielle kommunenumre. De offisielle norske, samiske og kvenske navnene for kommunene er hentet fra SSR. I tillegg finnes informasjon om samiske forvaltningsområder.\n\nGeometrien er avledet fra matrikkelen, som blir ajourført av kommunene. Riksgrense og territorialgrense er lagt inn fra Kartverkets egne etablerte filer."
  },
