  "description": {
    "nb": "Opplysninger om merverdiavgiftskompensasjon.\n\nKommuner, fylkeskommuner, private og ideelle virksomheter som krever kompensasjon for betalt merverdiavgift leverer melding for merverdiavgiftskompensasjon.\n\nMva-meldingen inneholder fordeling av samlet innkjøp i perioden fordelt etter mva-sats, og totalsum på mva for utbetaling"
  },
  "descriptionFormatted": {
    "nb": "Opplysninger om merverdiavgiftskompensasjon.\n\nKommuner, fylkeskommuner, private og ideelle virksomheter som krever kompensasjon for betalt merverdiavgift leverer melding for merverdiavgiftskompensasjon.\n\nMva-meldingen inneholder fordeling av samlet innkjøp i perioden fordelt etter mva-sats, og totalsum på mva for utbetaling"
  },
  "objective": {
    "nb": "Formålet er at kommuner, fylkeskommuner og enkelte private virksomheter som ikke er mva-registrerte på visse vilkår kan få kompensert mva de betaler ved kjøp av eksterne tjenester. Dette for å forhindre konkurransevridning ved at de ellers ville utført tjenestene selv."
  },
