  "title": {
    "nb": "Særavgiftsmeldinger "
  },
  "description": {
    "nb": "Særavgiftsmeldinger for særavgiftspliktige virksomheter. Det er ca. 30 forskjellige særavgifter, og alle innenlandske produsenter plikter å registrere seg som særavgiftspliktig hos Skatteetaten. Virksomheter som importerer varer som er avgiftsbelagt kan registrere seg som særavgiftspliktig."
  },
  "descriptionFormatted": {
    "nb": "Særavgiftsmeldinger for særavgiftspliktige virksomheter. Det er ca. 30 forskjellige særavgifter, og alle innenlandske produsenter plikter å registrere seg som særavgiftspliktig hos Skatteetaten. Virksomheter som importerer varer som er avgiftsbelagt kan registrere seg som særavgiftspliktig."
  },
  "objective": {
    "nb": "Formålet er å kunne egenfastsette grunnlag for særavgiftsmeldinger. Det er pliktig innlevering og innbetaling innen den 18. hver måned. 3 særavgifter har kvartalvis rapportering."
  },
