  },
  "description": {
    "nb": "Opplysninger om utenlandskregistrert kjøretøy og innbetalt engangsavgift for personer som bor i Norge.\n\nPersoner som bor i Norge kan i utgangspunktet ikke bruke utenlandskregistrert kjøretøy i landet uten å registrere kjøretøyet og innbetale engangsavgift. "
  },
  "descriptionFormatted": {
    "nb": "Opplysninger om utenlandskregistrert kjøretøy og innbetalt engangsavgift for personer som bor i Norge.\n\nPersoner som bor i Norge kan i utgangspunktet ikke bruke utenlandskregistrert kjøretøy i landet uten å registrere kjøretøyet og innbetale engangsavgift. "
  },
  "objective": {
    "nb": "Etterleve midlertidig forskriften (Forskrift om avgiftsfri innførsel og midlertidig bruk av utenlandsregistrert motorvogn i Norge) ved å melde inn bruk av utenlandsregistrert kjøretøy for en kort periode. Det er mulig å bruke utenlandsk leiebil (inntil 42 dager) og lånebil (inntil 25 dager) i løpet av en periode på 12 måneder. "
  },
